import React from 'react'
import Link from "./Link"

const links = [
  {id:"1", link: "#", name: "Home"},
  {id:"2", link: "#", name: "Search"},
  {id:"3", link: "#", name: "History"},
  {id:"4", link: "#", name: "Contact"}]

export default function Footer( ) {

  return (
    links.map(link => {
      return <Link key = {link.id} link = {link}/>
    })
  )
}
